import React from "react";
import { Field, reduxForm } from "redux-form";

const renderField = ({ input, label, type, meta: { touched, error, warning } }) => (
  <div>
    <label className="control-label">{label}</label>
    <div>
      <input {...input} placeholder={label} type={type} className="form-control" />
      {touched && ((error && <span className="text-danger">{error}</span>) || (warning && <span>{warning}</span>))}
    </div>
  </div>
)

class FormComp extends React.Component {

  render() {
    //const required = value => value ? undefined : 'Required'
    const { handleSubmit, pristine, reset, submitting } = this.props;
    return (
      <div className="form">
        <div className="ui raised very padded text container segment">
          <h2 className="ui header">Fill in the form</h2>

          <form
            onSubmit={handleSubmit}
            className="ui form info-form error"
          >

            <div>

              <div className="required field">
                <label>Weight in Kg</label>
                <Field
                  component={this.renderField}
                  name="weight"
                  //component="input"
                  type="number"
                  placeholder="Enter weight.."
                //validate={[required]}
                />
              </div>

              <div className="required field">
                <label>Age</label>
                <Field
                  component={this.renderField}
                  name="age"
                  //component="input"
                  type="number"
                  placeholder="Enter age.."
                  // validate={[required]}
                  className="required field"

                />
              </div>
              <div className="required field">
                <label>Height in Cm</label>
                <Field
                  component={this.renderField}
                  name="height"
                  //component="input"
                  placeholder="Enter height.."
                  type="number"
                  //validate={[required]}
                  className="required field"

                />
              </div>
              <div className="required field">
                <label>Activity Level</label>
                <Field
                  component={this.renderField}
                  name="activity"
                  component="select"
                  placeholder="Select activity.."
                  //validate={[required]}
                  className="required field">
                  <option />
                  <option value="Sedentary">Sedentary</option>
                  <option value="Light">Lightly Active</option>
                  <option value="Moderate">Moderately Active</option>
                  <option value="Very">Very Active</option>
                  <option value="Extreme">Extremely Active</option>
                </Field>

              </div>

              <div className="required field">
                <label>Select Gender</label>
                <div >
                  <label>
                    <Field
                      //component={this.renderInput}
                      className="ui radio checkbox"
                      name="gender"
                      component="input"
                      type="radio"
                      value="male"
                    //validate={[required]}
                    />
                    Male</label>

                  <label>
                    <Field
                      component={this.renderInput}
                      // className="ui radio checkbox"
                      name="gender"
                      component="input"
                      type="radio"
                      value="female"
                    // validate={[required]}
                    />
                    Female</label>

                </div>
              </div>
              <div >
                <button className="buttons submit huge left floated ui button"
                  type="submit" disabled={pristine || submitting}>Submit</button>
                <button className="buttons negative huge right floated ui button"
                  type="button"
                  disabled={pristine || submitting}
                  onClick={reset}
                >
                  Clear Values
          </button>
              </div>
            </div>

          </form>
        </div>
      </div>
    );
  }
}

const validate = formValues => {
  const errors = {};

  if (!formValues.weight) {
    errors.title = 'You must enter your weight!';
  }
  if (!formValues.age) {
    errors.description = 'You must enter your age!';
  }
  if (!formValues.height) {
    errors.description = 'You must enter your height!';
  }
  if (!formValues.gender) {
    errors.description = 'You must select your gender!';
  }
  if (!formValues.activity) {
    errors.description = 'You must select your activity!';
  }
  return errors;
}

FormComp = reduxForm({
  // a unique name for the form
  form: "contact",
  validate
})(FormComp);

export default FormComp;
